window.bookSummaryJSON = "<p>The mysterious, indomitable warrior? Ruthless criminal overlord? The Riel'gesh - mythical demigod? Dedicated friend and protector? </p> <p>Equipped with skills far beyond those of the outworlders, Rezkin has been suddenly thrust into a foreign world. The young warrior clings to his only known purpose as he continues his search for any information about his identity and the reason for his existence. </p> <p>While the hardened warrior scorns both dueling and tournaments, he believes some of the answers he seeks may be found at the King's Tournament, the greatest dueling championship in all of the kingdoms. As he searches for the elusive Striker Farson, who may be the only person alive who holds the clues, the young warrior and his friends embark on a journey fraught with danger, mystery, and intrigue. </p> <p>Amid fears of the kingdom's economic collapse, rumors of an eminent military draft, and the machinations of a mad, tyrannical king, a new revelation threatens to upend all the warrior's plans. </p> <p>This book is intended for adult listeners. It contains graphic violence, creative language, and sexual innuendo. This book does not contain explicit sexual content. </p>"; 
